 home.\n\n* There is a gradual rise in steps and intensities from 6:00 AM to 8:00 AM. This suggests that many users are engaging in morning routines which could include activities like morning walks, jogs, or commuting work. \n\n* Post 7:00 PM, the activity levels start to decline, reflecting users winding down for the day, relaxing, or engaging in less physically demanding activities.","metadata":{}},{"cell_type":"code","source":"# Calculate correlation coefficient\ncorrelation <- cor(daily_activity1$total_steps, daily_activity1$calories, use = \"complete.obs\")","metadata":{"execution":{"iopub.status.busy":"2024-07-30T17:17:09.617009Z","iopub.execute_input":"2024-07-30T17:17:09.618872Z","iopub.status.idle":"2024-07-30T17:17:09.633398Z"},"trusted":true},"execution_count":31,"outputs":[]},{"cell_type":"code","source":"# Plot correlation\n\nggplot(daily_activity1, aes(x = total_steps, y = calories)) +\n  geom_point(aes(color = calories)) +                        \n  geom_smooth(method = \"loess\", formula = y ~ x, color = \"blue\") +             \n  labs(title = \"Total Steps vs Calories\",\n       x = \"Total Steps\",\n       y = \"Calories\") +\n  annotate(\"text\", x = max(daily_activity1$total_steps) * 1.0, \n           y = max(daily_activity1$calories) * 1.0,\n           label = paste (\"Correlation:\", round(correlation, 2)), \n           hjust = 1, vjust = 1, size = 5, color = \"black\") +\n  theme_minimal() +\n  theme(plot.title = element_text(hjust=0.5))","metadata":{"execution":{"iopub.status.busy":"2024-07-30T17:17:13.662292Z","iopub.execute_input":"2024-07-30T17:17:13.66442Z","iopub.status.idle":"2024-07-30T17:17:15.463915Z"},"trusted":true},"execution_count":32,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wU1doH8OfM9pJseqUTekcMXQREUVSwYFfsvVw7Fuzee0WxXPu19/6KDUWB\niwoiSJcOaYTUzSbby+zOnPePhRCS3ZCEJLvZ/X3/4MOeKfvMzmT22TOnMM45AQAAAEDXJ0Q6\nAAAAAABoH0jsAA