nship indicates that as the number of steps taken increases, the calories burned also tend to increase.\n\n* This trend is visually supported by the upward slope of the loess regression line, reinforcing the connection between higher physical activity levels and greater caloric expenditure.","metadata":{}},{"cell_type":"code","source":"#Scatter plots between different type of activities and calories burned\n\ng1 <-ggplot(data = daily_activity1,aes(x = very_active_minutes, y = calories)) + \n  geom_point() + geom_smooth(method = \"loess\", formula = y ~ x, color = \"blue\") +\n  labs(title = \"Very Active Minutes Vs Calories\") \n\n\ng2<-ggplot(data = daily_activity1,aes(x = fairly_active_minutes, y = calories)) + \n  geom_point() + geom_smooth(method = \"loess\", formula = y ~ x, color = \"blue\") +             \n  labs(title = \"Fairly Active Minutes Vs Calories\")\n\ng3 <-ggplot(data = daily_activity1,aes(x = lightly_active_minutes, y = calories)) + \n  geom_point() + geom_smooth(method = \"loess\", formula = y ~ x, color = \"blue\") +             \n  labs(title = \"Lightly Active Minutes Vs Calories\")\n\n\ng4 <-ggplot(data = daily_activity1,aes(x = sedentary_minutes, y = calories)) + \n  geom_point() + geom_smooth(method = \"loess\", formula = y ~ x, color = \"blue\") +\n  labs(title = \"Sedentary Minutes Vs Calories\")\n\n\n(g1|g2) / (g3|g4)","metadata":{"execution":{"iopub.status.busy":"2024-07-30T17:17:20.480757Z","iopub.execute_input":"2024-07-30T17:17:20.482411Z","iopub.status.idle":"2024-07-30T17:17:22.035978Z"},"trusted":true},"execution_count":33,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOydd1wUxxfA3+71Qq8qiApixUbs3ZhibxE19pqYxJiIifKLUWOLsaUYjRpMjGI3\nEbsxFuyiKEZBBSsiKB3ujuPqzu+P1fNyjeW4Bsz3Dz7H7OzMm9mZt2+nvCEQQoDBYDAYDAaD\nqfqQzhYAg8FgMBgMBmMbsGGHwWAwGAwGU03Ahh0Gg8FgMBhMNQEbdhgMBoPBYDDVBGzYYTAY\nDAaDwVQTsGGHwWAwGAwGU03Ahh0Gg8FgMBhMNQEbdhgMBoPBYDDVBGzYY