tes = sum(very_active_minutes, na.rm = TRUE),\n    fairly_active_minutes = sum(fairly_active_minutes, na.rm = TRUE),\n    lightly_active_minutes = sum(lightly_active_minutes, na.rm = TRUE),\n    sedentary_minutes = sum(sedentary_minutes, na.rm = TRUE)\n  )\n\n# Convert to long format for ggplot2\nactivity_long <- activity_summary %>%\n  pivot_longer(cols = everything(), names_to = \"activity\", values_to = \"minutes\")\n\n# Create the pie chart\nggplot(activity_long, aes(x = \"\", y = minutes, fill = activity)) +\n  geom_bar(stat = \"identity\", width = 1) +\n  coord_polar(theta = \"y\") +\n  labs(title = \"Distribution of Activity Minutes\", x = NULL, y = NULL) +\n  theme_minimal() +\n  theme(axis.ticks = element_blank(), \n        axis.text = element_blank(), \n        panel.grid = element_blank(), \n        plot.title = element_text(hjust = 0.5)) +\n  scale_fill_brewer(palette = \"PuBuGn\")","metadata":{"execution":{"iopub.status.busy":"2024-07-30T17:17:27.01848Z","iopub.execute_input":"2024-07-30T17:17:27.020169Z","iopub.status.idle":"2024-07-30T17:17:27.447798Z"},"trusted":true},"execution_count":34,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3xb1d3H8XMlS97bjrN3SIAEAjSsNECZZY+WFijQUmYptIwQQh82ZbWMsqFl\nlxZaykiAEAhZrEBIGFnOcLz3kq0t3fX8oWAcx0O2JV3p6vP+gxeRr8/9WfOrc8+QdF0XAAAA\nSHwWowsAAABAZBDsAAAATIJgBwAAYBIEOwAAAJMg2AEAAJgEwQ4AAMAkCHYAAAAmQbADAAAw\nCYIdAACASRDsAAAATIJgBwAAYBIEOwAAAJMg2AEAAJgEwQ4AAMAkCHYAAAAmQbADAAAwCYId\nAACASRDsAAAATIJgBwAAYBIEOwAAAJMg2AEAAJgEwQ4AAMAkCHYAAAAmQbADAAAwCYIdAACA\nSRDsAAAATIJgBwAAYBIEOwAAAJMg2AEAAJgEwQ4AAMAkCHYAAAAmQbADAAAwCYIdAACASRDs\nAAAATIJgBwAAYBIEOwAAAJMg2AEAAJgEwQ4AAMAkCHYAAAAmQbADAAAwCYIdAACASRDsAAAA\nTIJgBwAAYBIEOwAAAJMg2AEAAJgEwQ4AAMAkCHYAAAAmQbADAAAwCYIdAACASRDsAAAATIJg\nBwAAYBIEOwAAAJMg2AEAAJgEwQ4AAMAkCHYAAAAmQbADAAAwCYIdAACASRDsAAAATIJgBwAA\nYBIEOwAAAJMg2AEAAJgEwQ4AAMAkCHYAAAAmQbADAAAwCYIdAACASRDsAAAATIJgBwAAYBIE\nOw